    /**
     * POST 请求
     *
     * @param url 请求地址
     * @param body 请求体
     * @param headers 请求头
     * @return 响应体
     */
    public String sendPost(String url, String body, Map<String, String> headers ) {
        HttpHeaders httpHeaders = new HttpHeaders();
        if (headers != null) {
            headers.forEach(httpHeaders::set);
        }
        httpHeaders.setContentType(MediaType.APPLICATION_JSON);
        httpHeaders.set("Content-Encoding", "gzip");
        HttpEntity<String> entity = new HttpEntity<>(body, httpHeaders);

        long startTime = System.currentTimeMillis();
        RestTemplate restTemplate = new RestTemplate();
        try {
            ResponseEntity<String> response = restTemplate.exchange(url, HttpMethod.POST, entity, String.class);
            return response.getBody();
        } catch (Exception e) {
           // logger.error("request:{};exception: {}", url, e.toString());
            return "";
        } finally {
            long duration = System.currentTimeMillis() - startTime;
          //  logger.info("POST 请求完成: URL = {}, 耗时 = {} ms", url, duration);
        }
    }
    /**
     * GET 请求
     *
     * @param url     请求地址
     * @param headers 请求头
     */
    public static void sendGet(String url, String params, Map<String, String> headers) {
        HttpHeaders httpHeaders = new HttpHeaders();
        if (headers != null) {
            headers.forEach(httpHeaders::set);
        }
        HttpEntity<String> entity = new HttpEntity<>(httpHeaders);

        long startTime = System.currentTimeMillis();
        RestTemplate restTemplate = new RestTemplate();
        try {
            ResponseEntity<String> response = restTemplate.exchange(url+params, HttpMethod.GET, entity, String.class);
            System.out.println(response.getBody());
        } catch (Exception e) {
            //logger.error("request:{};exception: {}", url, e.toString());
        } finally {
            long duration = System.currentTimeMillis() - startTime;
           // logger.info("GET 请求完成: URL = {}, 耗时 = {} ms", url, duration);
        }
    }
